  ('67646990-edea-4e56-9723-4181805fed81', 'orn-liigutamine-parem-kui-taielig-puhkus', 'Õrn liigutamine on parem kui täielik puhkus', 'Kergete liigutuste abil paraneb kaelavalu kiiremini kui täieliku puhkusega.', 'Kaelavalu', 'TLDR', 4, 'kõrge', true, '2025-09-23T08:05:46.720363+00:00', '2025-09-27T21:00:52.992884+00:00', '# Kaelavalu korral - liikumine, mitte jäikus

Kaelavalu korral on loomulik instinkt hoida kaela täiesti paigal. Tegelikult võib see olukorda halvendada. Õrnad liigutused aitavad kiiremini paranemise.

## Miks liikumine aitab?

Vale uskumus on, et valu korral peab hoida kaetud kohta täiesti liikumatu. Tegelikult:

**Liikumine parandab:**
- Vereringe kaetud alal
- Lihaste elastsust
- Toitainete jõudmist koeudesse
- Jäikuse ja krahmi vähenemist

**Liikumatus halvendab:**
- Lihased muutuvad jäigaks
- Vereringe aeglustub
- Valu võib püsida kauem
- Liikuvusel piirangle suureneb

## Õrnad harjutused päevaks

**Hommikul (5 minutit):**

1. **Aeglase kaela pöörused**
   - Pööra pead aeglaselt paremale (5 sek)
   - Tagasi keskele
   - Pööra vasakule (5 sek)
   - Korda 3 korda

2. **Pea kaldutamine**
   - Kalduta pead ettevaatlikult vasakule õlale
   - Hoia 10 sekundit
   - Tagasi keskele, siis paremale
   - Korda 3 korda mõlemale poole

**Päeva jooksul (iga 2 tunid):**

3. **Õlgade tõstmine**
   - Tõsta mõlemad õlg aeglaselt üles
   - Hoia 5 sekundit
   - Lase aeglaselt alla
   - Korda 5 korda

## Millal mitte liigutada

**Peate koheselt:**
- Tugev valu, mis ei lase magada
- Kätes tuimenemine või torkivad tunnetus
- Peavalu koos iiveldusega
- Palaviku olemasolu

## Lisaabinõud

**Soojendamine:**
- Soe dušš 10 minutit
- Soe kompress 15 minutit
- Põgujõhv massees

**Vältyda:**
- Järsked liigutused
- Rasket kott ühe õla peal kandmine
- Pikk ekraani vaatamine (ilma pausindeta)
- Matta äärne magamine

## Millal pöörduda arsti poole?

- Valu kestab üle 5 päeva
- Valu kiirgub kätte
- Tekib käte nõrkust
- Peavalu muutub tugevamaks

## Ennetamine tulevikuks

- Hoia ekraan silmade kõrgusel
- Tee regulaarselt kaelaharjutusi
- Kasuta ergonoomlise padjast
- Väldi äkilisi pea liigutusi

