  ('811fc537-c673-442b-9090-4462b20d7101', 'plangi-harjutus-tuumiku-tugevdamiseks', 'Plank - täiuslik harjutus tuumikule', 'Plank-harjutus tugevdab kogu keha tuumikut ja parandab rühti vaid 30 sekundiga päevas.', 'Liikumine', 'Steps', 5, 'kõrge', true, '2025-09-24T10:14:08.423079+00:00', '2025-09-27T21:03:29.297716+00:00', '# Plank - üks harjutus, mis tugevdab kogu kere

