  ('c16e1ace-bc1a-4099-9d35-b68dcc4922e9', 'kaks-lihtsat-jouharjutust-kodus', 'Kaks lihtsat jõuharjutust kodus', 'Kükk ja lükked säilitavad lihasmassi ilma jõusaalita.', 'Lihasmassi vähenemine', 'Steps', 5, 'kõrge', true, '2025-09-23T08:05:46.720363+00:00', '2025-09-27T21:00:52.992884+00:00', '# Kaks harjutust, mis säilitavad lihasmassi

Peale 30. eluaastat kaotame lihases keskmiselt 3-8% kümnendi kohta. Kahe lihtsa harjutusega saab selle protsessii märkimisväärselt aeglustada.

## Miks just kükid ja lükked?

Need on **liitharjutused** - nad kaasavad korraga mitmeid suur lihasgruppe:

**Kükid aktiveerivad:**
- Reielihases (quadriceps, hamstrings)
- Tuharalihased (glutes)
- Kerekeskme lihases
- Säärelihases stabilisaatori

**Lükked aktiveerivad:**
- Rindalihases
- Õlalihases
- Käsivarsi tagumisi
- Kerekeskme stabilisaatori

## Õige kükki tehnika

**Algseis:**
- Jalg õlgade laiuses
- Varbad veidi väljapoole
- Keha kaal kande keskossa
- Vaata otse ette

**Liikuvus:**
1. Alusta liigutust puusa tagapoole lükkamisega
2. Lase põlved järgneda - nad liiguvad varbaste suunas
3. Laskuge, kuni reied on põrandaga paralleelselt
4. Tugev vajutamine kandadelt - tagasi üles

**Levinud vead:**
- Põlved liiguvad sisse poole
- Kannast kaal varbaste osale
- Selg kummardub liiga palju ette

## Õige lügede tehnika

**Põrandalt (raske variant):**
- Käed õlgade laiuses
- Kehakandidaat kanne sirge joon
- Lase rind põrandasilma
- Tugev lüke tagasi üles

**Põlvedelt (kergem variant):**
- Sama nagu põrandalt, kuid toetu põlvedele
- Hoia keha sirge päast põlvedeni
- Keskenduma aeglasele liigutusele

**Vaid altpoolt (kõige kergem):**
- Käed seinal
- Seisa kaugemal seinal
- Lükka ennast seinal vasi ja tagasi

## Treeningkava algajatedele

**Näd 1-2:**
- Kükid: 2 seerias x 8 kordust
- Lükked: 2 seerias x 5-8 kordust
- Puhkus seeriad vahele: 1-2 minutit
- Sagedus: 3 korda nädalas

**Näd 3-4:**
- Kükid: 3 seeriad x 8-12 kordust
- Lükked: 3 seeriad x 6-10 kordust
- Puhkus: 1-2 minutit
- Sagedus: 3 korda nädalas

**Edasijõudnutele:**
- Lisa raskes (seljakott, hantelad)
- Suurenda kordusicohti
- Lae variantse (hüpe kükid, diamond lükked)

## Progressioori näpunäited

**Kükide raskendamiseks:**
- Hoia käed rindel (rist)
- Kasuta seljakotti
- Tee aeglasemalt (3 sek alla, 1 sek üles)
- Proovi ühe jalaga kükkil

**Lügede raskendamiseks:**
- Tõsta jalad toolile
- Lisa käte alla raskus
- Muutee kätet positsioon (kitsas, lai)
- Diamond lükked (käed rombi kujul)

## Milline resultaat oodata?

**2-4 nädala pärast:**
- Parem jõud igapäevaste toimetustest
- Tugev kerekeskme
- Parem ryhtu

**2-3 kuu pärast:**
- Märgatav lihasmassi kasvu
- Paremat luude tihedus
- Kiirelema aineivahetusel

## Sagedasemid küsimused

**Kui tihti treeni?**
3 korda nädalas on optimaalne. Ütlemage ja raskendamist vahele puhkusepäeva.

**Kas see piisab?**
Lihasmassi säilitamiseks jah. Suurema massi kasvu saavutamiseks on vaja rohkem harjutusi ja raskust.

**Millal lisada raskust?**
Kui suudad teha 12+ kordust kergelt.

